import React, { useEffect, useState } from 'react';
import Header from '../components/header';
import Sidebar from '../components/sidebar';
import StarsBackground from '../components/stars';
import Posts from '../components/posts';

const Main = () => {
    return (
        <>
            <Header />
            <Sidebar />
            <StarsBackground />
            <Posts />
        </>
    );
};

export default Main;
